        stack = []
        i = 0
        while i < len(text):
            if text[i] == 'S':
                new_string = ""
                while i < len(text) and text[i].isalpha():
                    new_string += text[i]
                    i += 1
                stack.append(new_string)
                i -= 1
            elif text[i] == 'NT':
                if i + 1 < len(text) and text[i+1] == '1':
